    <style>
        .c,
        body {
            text-align: center;
            font-family: verdana
        }

        div,
        input,
        select {
            padding: 5px;
            font-size: 1em;
            margin: 5px 0;
            box-sizing: border-box
        }

        input,
        button,
        select,
        .msg {
            border-radius: .3rem;
            width: 100%
        }

        input[type=radio],
        input[type=checkbox] {
            width: auto
        }

        button,
        input[type='button'],
        input[type='submit'] {
            cursor: pointer;
            border: 0;
            background-color: #1fa3ec;
            color: #fff;
            line-height: 2.4rem;
            font-size: 1.2rem;
            width: 100%
        }

        input[type='file'] {
            border: 1px solid #1fa3ec
        }

        .wrap {
            text-align: left;
            display: inline-block;
            min-width: 260px;
            max-width: 500px
        }

        a {
            color: #000;
            font-weight: 700;
            text-decoration: none
        }

        a:hover {
            color: #1fa3ec;
            text-decoration: underline
        }

        .q {
            height: 16px;
            margin: 0;
            padding: 0 5px;
            text-align: right;
            min-width: 38px;
            float: right
        }

        .q.q-0:after {
            background-position-x: 0
        }

        }

        }

        .q.q-4:after {
            background-position-x: -64px
        }

        }

        }

            padding: 20px;
            margin: 20px 0;
            border: 1px solid #eee;
            border-left-width: 5px;
            border-left-color: #777
        }

        .msg h4 {
            margin-top: 0;
            margin-bottom: 5px
        }

        .msg.P {
            border-left-color: #1fa3ec
        }

        .msg.P h4 {
            color: #1fa3ec
        }

        .msg.D {
            border-left-color: #dc3630
        }

        .msg.D h4 {
            color: #dc3630
        }

        .msg.S {
            border-left-color: #5cb85c
        }

        .msg.S h4 {
            color: #5cb85c
        }

            font-weight: bold
        }

        dd {
            margin: 0;
            padding: 0 0 0.5em 0;
            min-height: 12px
        }

        td {
            vertical-align: top;
        }

        .h {
            display: none
        }

        button {

            transition-delay: 3s;
            transition-duration: 0s;
            cursor: pointer
        }

        button.D {
            background-color: #dc3630
        }

        button:active {
            opacity: 50% !important;
            cursor: wait;
            transition-delay: 0s
        }

        body.invert,
        body.invert a,
        body.invert h1 {
            background-color: #060606;
            color: #fff;
        }

        body.invert .msg {
            color: #fff;
            background-color: #282828;
            border-top: 1px solid #555;
            border-right: 1px solid #555;
            border-bottom: 1px solid #555;
        }

        body.invert .q[role=img] {
            -webkit-filter: invert(1);
            filter: invert(1);
        }

        :disabled {
            opacity: 0.5;
        }
